document.addEventListener("DOMContentLoaded", () => {
    const { jsPDF } = window.jspdf;

    const calculateButton = document.getElementById("calculate-button");
    const modal = document.getElementById("myModal");
    const pdfModal = document.getElementById("pdfModal");
    const closeButton = document.querySelectorAll(".close");
    const option1 = document.getElementById("option1");
    const option2 = document.getElementById("option2");
    const downloadPdfButton = document.getElementById("download-pdf");
    const cancelDownloadButton = document.getElementById("cancel-download");

    // Base64 واقعی فونت را قرار دهید
    const IRANSansBase64 = '';

    function performCalculation(type) {
        const mdey = parseFloat(document.getElementById("mdey").value) || 0;
        const pdey = parseFloat(document.getElementById("pdey").value) || 0;
        const mkhordad = parseFloat(document.getElementById("mkhordad").value) || 0;
        const pkhordad = parseFloat(document.getElementById("pkhordad").value) || 0;

        let modey, mokhordad, mosalaneh;

        if (type === 'second') {
            modey = ((mdey * 1) + (pdey * 2)) / 3;
            mokhordad = ((mkhordad * 1) + (pkhordad * 4)) / 5;
            mosalaneh = ((mdey * 1) + (pdey * 2) + (mkhordad * 1) + (pkhordad * 4)) / 8;
        } else {
            modey = Math.ceil(((mdey * 1) + (pdey * 1)) / 2);
            mokhordad = Math.ceil(((mkhordad * 1) + (pkhordad * 1)) / 2);
            mosalaneh = (modey + (mokhordad * 2)) / 3;
        }

        modey = modey.toFixed(2);
        mokhordad = mokhordad.toFixed(2);
        mosalaneh = mosalaneh.toFixed(2);

        const resultText =
            "نمره دی ماه  :" + modey + "\n" +
            "نمره خردادماه  :" + mokhordad + "\n" +
            "نمره سالانه  :" + mosalaneh + "\n" +
            "ملاک قبولی کسب حداقل نمره 10 در نمره سالانه می باشد";

        document.getElementById("result").innerText = resultText;

        // نمایش مدال تأیید دانلود PDF
        if (pdfModal) {
            pdfModal.style.display = "block";
            document.body.style.overflow = "hidden"; // مخفی کردن اسکرول صفحه در هنگام نمایش مدال
        }
    }

    function generatePDF(resultText) {
        const doc = new jsPDF();

        // اضافه کردن فونت سفارشی
        if (IRANSansBase64) {
            doc.addFileToVFS('IRANSans.ttf', IRANSansBase64.replace(/^data:font\/ttf;base64,/, ''));
            doc.addFont('IRANSans.ttf', 'IRANSans', 'normal');
            doc.setFont('IRANSans');
        }

        // اضافه کردن سربرگ
        doc.setFontSize(16);
        doc.text("آکادمی آموزشی یونس کبیری", 105, 10, { align: 'center' });
        doc.text("سامانه محاسبه نمره و معدل", 105, 20, { align: 'center' });

        // اضافه کردن نتایج محاسبه
        doc.setFontSize(12);
        doc.text(resultText, 10, 40);

        doc.save('result.pdf');
    }

    if (calculateButton) {
        calculateButton.addEventListener('click', () => {
            if (modal) modal.style.display = "block";
            document.body.style.overflow = "hidden"; // مخفی کردن اسکرول صفحه در هنگام نمایش مدال
        });
    }

    if (closeButton) {
        closeButton.forEach(button => {
            button.addEventListener('click', () => {
                if (modal) modal.style.display = "none";
                if (pdfModal) pdfModal.style.display = "none";
                document.body.style.overflow = "auto"; // فعال کردن اسکرول صفحه
            });
        });
    }

    if (option1) {
        option1.addEventListener('click', () => performCalculation('first'));
    }

    if (option2) {
        option2.addEventListener('click', () => performCalculation('second'));
    }

    if (downloadPdfButton) {
        downloadPdfButton.addEventListener('click', () => {
            const resultText = document.getElementById("result").innerText;
            generatePDF(resultText);
            if (pdfModal) {
                pdfModal.style.display = "none";
                document.body.style.overflow = "auto"; // فعال کردن اسکرول صفحه
            }
        });
    }

    if (cancelDownloadButton) {
        cancelDownloadButton.addEventListener('click', () => {
            if (pdfModal) {
                pdfModal.style.display = "none";
                document.body.style.overflow = "auto"; // فعال کردن اسکرول صفحه
            }
        });
    }
});